import './fullpage.css';
import './js';

function Main(){
    useEffect(() => {
        new Main('#fullpage', {
            sectionsColor: ['#f1c40f', '#e74c3c', '#3498db', '#2ecc71'],
        });
    }, []);
    return(
        <div id="fullpage">
            <div className="section">Some section</div>
            <div className="section">Some section</div>
            <div className="section">Some section</div>
            <div className="section">Some section</div>
        </div>

    );
}

export default Main;
